import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { Lesson } from 'src/app/classes/lesson';
import { Video } from 'src/app/classes/video';
import { ExercisesValueService } from 'src/app/services/exercises-value.service';
import { LessonService } from 'src/app/services/lesson.service';

@Component({
  selector: 'app-video-tamildetails',
  templateUrl: './video-tamildetails.component.html',
  styleUrls: ['./video-tamildetails.component.css']
})
export class VideoTamildetailsComponent {

  formData = {
    tamilUrl:''
    // Add more properties for other form fields
  }
  lesson!: Lesson
  constructor(
    private exercises: ExercisesValueService,
    private router: Router,
    private lessonService: LessonService
  ){

  }

  ngOnInit(): void {
    this.loadChaptersDetails();      
  }

  loadChaptersDetails(){
    return this.exercises.ChapterDetails.subscribe(data=>{
      this.lesson = data;
    })
  }

  backtochapterdetails(){
    this.router.navigate(['members','admin','chapterdetails']);
  }

  onSubmit(form: any) {
    console.log("the video url is" +this.lesson.name);
    // Access form data using form.value and assign it to a variable
    const submittedData = { ...form.value };
    // You can now use 'submittedData' in your component as needed
     this.lesson.video[0].url = submittedData.tamilurl;

    console.log("the video url is" +this.lesson.video[0].url);
    console.log("the submittedform value" +submittedData);

    //Call Service
    this.lessonService.postVideo(this.lesson).subscribe((data=>{
      console.log();
    })
    );




    //Clear the data after data is submitted
    this.formData.tamilUrl = ''
    window.location.reload();

  }


}
<div class="body">
    <button id="createButton" data-bs-toggle="modal" data-bs-target="#addVideoModal">Create</button>
    <button id="createButton" (click)="backtochapterdetails()">Back to chapterDetails </button>
    <table>
        <thead>
            <tr>
                <th>SL.No</th>
                <th>Video URL</th>
                <th>Action</th>
               </tr>
        </thead>
        <tbody>

            <tr>
                <td>{{1}}</td>
                <td>{{lesson.video[0].url}}</td>
                <td><button class="edit-button">Edit</button>
                <button class="delete-button">Delete</button></td>
            </tr>

        </tbody>
    </table>
</div>


<!-- Modal -->
<div class="modal fade" id="addVideoModal" tabindex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
    <div class="modal-dialog">
        <div class="modal-content">
            <div class="modal-header">
                <h5 class="modal-title" id="exampleModalLabel">Add Video</h5>
                <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
            </div>
            <div class="modal-body">

                <!--Insert Form Code Start-->
                <form #chapterForm="ngForm" (ngSubmit)="onSubmit(chapterForm)">
                    <div class="mb-3 row">
                        <label for="chapterName" class="col-sm-2 col-form-label">Video URL</label>
                        <div class="col-sm-10">
                            <input type="text" class="form-control" id="chapterName" placeholder="Enter chapter name" name="tamilUrl" [(ngModel)]="formData.tamilUrl" required>
                        </div>
                    </div>
                    <div class="modal-footer">
                        <button type="button" class="btn btn-secondary" data-bs-dismiss="modal">Cancel</button>
                        <button type="submit" class="btn btn-primary" data-bs-dismiss="modal" >Save</button>
                    </div>
                </form>
                <!--Insert Form Code End-->
            </div>
        </div>
    </div>
